import React from 'react';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
const CreateNote = () => {
  return (
    <>
      <div className="main_note">
         <form>
             <input type="text" placeholder="title"/>
         </form>
      </div>
    </>
  );
}


export default CreateNote;
